import React from 'react';
import { FiSearch } from 'react-icons/fi'
import images from '../../constants/images';
import './Navbar.css';

const Navbar = () => (
  <nav className="app__navbar">
      <div className="app__navbar-logo">
        <img src={images.gericht} alt="app__logo" />
      </div>
      <form className='app__navbar-form'>
      <input className="ais-SearchBox-input" placeholder="Search collections" spellcheck="false" type="search" value=""> <FiSearch /></input>
      <button class="ais-SearchBox-submit" title="" type="submit"><FiSearch /></button>
      </form>
      </nav>
);

export default Navbar;
